(4, 'Keshet Cave', 100, '2023-11-04', '10:00:00', 200.00, 80, 1, 'Departure time is on Saturday at 4 pm\r\nKeshet Cave\r\nA break at Mishor `Ammi`az\r\nFish Trail \r\nWatching the sunrise from the top of Mount Sodom\r\nReturn hour (approximately) Saturday at 12 noon', 0x75706c6f6164732f4552442e6a7067),
(13, 'Nir David', 40, '2023-09-02', '08:00:00', 150.00, 50, 1, 'Our first stop: Breakfast at Marj Al-Yanabi (bathrooms and changing clothes)\r\nNahal Hakibbutzim: Water Track - The water track for adults in several sections \r\n(it is possible to take children with floats or something similar, under the responsibility of the parents) \r\n- The track is 2-3 hours in water, part of which is swimming.\r\nLunch in Ein Izrael next to a water spring - the spring is very suitable for children\r\nThe program includes friendship, love, and ODT activities', 0x75706c6f6164732f4552442e6a7067),
(18, 'Jordan River', 3, '2023-03-26', '08:00:00', 150.00, 50, 1, 'Jeep Tour for two hours\r\nJordan River mountain path\r\nOur lunch will be in Dardara', 0x75706c6f6164732f4552442e6a7067),
(19, 'Dead Sea', 15, '2023-07-14', '16:00:00', 150.00, 80, 3, 'We will leave the heat of the July sun.. and go to the gentle night breezes of the desert\r\nDeparture time is on Friday at 4 pm\r\nOur track is a track of excitement and passion - a night track in the Dead Sea area\r\nWe will start our night in Tamrur Cliff\r\nAnd we seal it and watch for the dawn in Ein Bokek\r\nWe will continue our path and walk on the Dead Sea Mushrooms\r\nReturn hour (approximately) Saturday at 12 noon', 0x75706c6f6164732f63727569736574726970732e706e67),
(22, 'Acre, Israel', 13, '2023-09-18', '08:30:00', 100.00, 40, 4, 'Lecture about fish and a visit to local fisheries\r\nA track in the authentic old market and getting to know the popular food in Acre\r\nVisit the port and fishermen boats\r\nVisit the old Bishtawi bakery\r\nVisit the Knights Hall and the Basha Grove\r\nThe tour includes an original Akkawai breakfast', 0x75706c6f6164732f436f6e6365707475616c2e6a7067),
(23, 'Nimrod Castle', 117, '2023-01-14', '09:00:00', 120.00, 50, 1, 'A tour in Ein Qiniya\r\nA tour in Nimrod Castle\r\nOur path is from Nimrod Castle to Banias Falls', 0x75706c6f6164732f4552442e6a7067),
(24, 'Wadi Qelt', 1, '2023-02-04', '08:00:00', 150.00, 50, 1, 'Our journey in Wadi Qelt\r\nFrom Ein Prat-Ein Fara to Ein Fawar \r\nLunch break in Jericho', NULL),
(25, 'Makhtesh Ramon', 100, '2023-08-18', '16:00:00', 200.00, 100, 3, 'Departure to the Negev region on Friday afternoon to the Negev region\r\nThe camping site is at Borot Lots\r\nWe will enjoy seeing the Milky Way and the stars\r\nThe program includes: guidance, dinner, activities and a cup of tea\r\nOn Saturday, departure at five in the morning to watch the sunrise from Makhtesh Ramon\r\nHead north', NULL),
(26, 'Hasbani River', 75, '2023-07-10', '08:00:00', 150.00, 50, 1, 'Our first stop in Rosh Pinna, a tour between the houses\nBreakfast break at Power-Junction\nA short wonderful walking track in the Nakiki Yaftah Reserve\nOur walking track in the Hasbani Nature Reserve\nLunch break at the end of the walking path', NULL),
(34, 'Hammat Tiberias', 12, '2023-01-21', '08:00:00', 150.00, 80, 1, 'Visiting Ain al-Maqli and Ain al-Rih in Hammat Tiberias\r\nOur path in Nahal El Al', NULL),
(35, 'Kiryat Shmona', 25, '2023-05-27', '08:00:00', 120.00, 50, 1, 'Travel via Route 85 towards Kiryat Shemona\r\nOur breakfast will be in the village of Nahal Ein Zahav\r\nAn interesting shaded path by the Hasbani River\r\nFrom Beit Hillel to Kfar Blum Kayaks, with access to sections of the Hasbani River\r\nLunch break in Dardara\r\nOn our way back - a stop at the mountainous Jordan River, with the possibility of a light circular path', NULL),
(36, 'Upper Galilee', 21, '2023-05-14', '08:30:00', 120.00, 80, 1, 'Nahal Amud\r\nMount Godrim Reserve and Mount Sasa\r\nPaar Cave Loop\r\n', NULL),
(37, 'Mount Meron', 21, '2022-12-17', '08:00:00', 120.00, 50, 1, 'The ring path of Mount Meron\r\nTour in Mount Meron Nature Reserve\r\nClimbing ', NULL);

